// Lê a saída do node anterior (Execute Command)
const raw =
  items?.[0]?.json?.stdout ??
  items?.[0]?.stdout ??
  '';

const channelId =
  items?.[0]?.json?.CHANNEL_ID ??
  items?.[0]?.CHANNEL_ID ??
  null;

// hh:mm[:ss] -> segundos
function parseDurationToSeconds(s) {
  if (!s) return null;
  const parts = s.split(':').map((n) => Number(n));
  if (parts.some(Number.isNaN)) return null;
  if (parts.length === 3) return parts[0] * 3600 + parts[1] * 60 + parts[2];
  if (parts.length === 2) return parts[0] * 60 + parts[1];
  if (parts.length === 1) return parts[0];
  return null;
}

// "YYYY-MM-DD HH:MM:SS" -> ISO UTC
function toISO(datetimeStr) {
  if (!datetimeStr) return null;
  return datetimeStr.replace(' ', 'T') + 'Z';
}

const out = [];

for (const line of raw.split('\n')) {
  const trimmed = line.trim();
  if (!trimmed) continue;

  // Divide por " | " preservando pipes dentro do título:
  // id | ...título (pode ter |) ... | duration | datetime | url
  let parts = trimmed.split(' | ');
  if (parts.length < 5) {
    // fallback se não vier com espaços ao redor do pipe
    parts = trimmed.split('|').map((p) => p.trim());
  }
  if (parts.length < 5) {
    // linha malformada — retorna crua pra inspeção
    out.push({ json: { raw: trimmed, parseError: 'Not enough parts' } });
    continue;
  }

  const id = parts.shift();
  const url = parts.pop();
  const dateStr = parts.pop();
  const durationStr = parts.pop();
  const title = parts.join(' | '); // remonta o título preservando pipes internos

  const durationSeconds = parseDurationToSeconds(durationStr);
  const publishedAtISO = toISO(dateStr);
  const publishedAtEpoch = publishedAtISO ? Math.floor(Date.parse(publishedAtISO) / 1000) : null;

  out.push({
    json: {
      videoId: id,
      title,
      duration: durationStr,          
      durationSeconds,                
      publishedAt: dateStr,           
      publishedAtISO,                 
      publishedAtEpoch,               
      url,
      channelId: $('VAR').first().json.CHANNEL_ID,
      processed: false
    },
  });
}

return out;

// n8n Code node (JavaScript)
// Entrada: items = [{ json: { video: "<string JSON>" } }, ...]
// Saída:   [{ json: { id, title, ... } }, ... ]

function safeParse(s) {
  try { return JSON.parse(s); } catch { return null; }
}

const out = [];

for (const item of items) {
  // aceita tanto item.json.video quanto item.video (defensivo)
  let payload = item?.json?.video ?? item?.video ?? null;
  let obj = null;

  if (typeof payload === 'string') {
    const s = payload.trim();

    // 1) tenta parse direto (é o seu caso)
    obj = safeParse(s);

    // 2) fallback para JSON duplamente encodado: "\"{...}\""
    if (!obj && s.startsWith('"') && s.endsWith('"')) {
      const unwrapped = safeParse(s);      // tira a casca externa
      if (typeof unwrapped === 'string') {
        obj = safeParse(unwrapped);        // parse do JSON interno
      }
    }
  } else if (payload && typeof payload === 'object') {
    // caso já venha como objeto (raro)
    obj = payload;
  }

  if (!obj) {
    out.push({ json: { _error: 'parse_failed', _raw: payload } });
    continue;
  }

  // Garante ID no padrão video:<channelId>_<videoId>
  if ((!obj.id || !/^video:/.test(obj.id)) && obj.channelId && obj.videoId) {
    obj.id = `video:${obj.channelId}_${obj.videoId}`;
  }

  // Coerções de tipo (defensivas)
  if (typeof obj.durationSeconds === 'string' && /^-?\d+$/.test(obj.durationSeconds)) {
    obj.durationSeconds = parseInt(obj.durationSeconds, 10);
  }
  if (typeof obj.publishedAtEpoch === 'string' && /^-?\d+$/.test(obj.publishedAtEpoch)) {
    obj.publishedAtEpoch = parseInt(obj.publishedAtEpoch, 10);
  }
  if (typeof obj.processed === 'string') {
    obj.processed = obj.processed.toLowerCase() === 'true';
  }

  out.push({ json: obj });
}

return out.filter(value => value.json.processed==false);

// Entrada: 1 item com várias props { "video:...": "{...json...}", ... }
// Saída: N itens -> { key, id, title, duration, durationSeconds, publishedAt, publishedAtISO, publishedAtEpoch, url, channelId, videoId, processed:false }

const out = [];

for (const item of items) {
  const obj = item.json || {};

  for (const [key, raw] of Object.entries(obj)) {
    if (!key.startsWith("video:")) continue;

    // Parse seguro
    let parsed = raw;
    if (typeof raw === "string") {
      try {
        parsed = JSON.parse(raw);
      } catch {
        continue;
      }
    }
    if (!parsed || typeof parsed !== "object") continue;

    // Normaliza processed (aceita "true"/"false" string)
    let processed = parsed.processed;
    if (typeof processed === "string") {
      const s = processed.trim().toLowerCase();
      processed = s === "true" ? true : s === "false" ? false : undefined;
    } else {
      processed =
        processed === true ? true : processed === false ? false : undefined;
    }
    if (processed !== false) continue; // apenas não processados

    // Normaliza datas/campos
    const id = parsed.id ?? key;

    const publishedAtISO =
      parsed.publishedAtISO ??
      (parsed.publishedAt
        ? new Date(parsed.publishedAt.replace(" ", "T") + "Z").toISOString()
        : null);

    const publishedAtEpoch =
      typeof parsed.publishedAtEpoch === "number" &&
      !Number.isNaN(parsed.publishedAtEpoch)
        ? parsed.publishedAtEpoch
        : publishedAtISO
          ? Math.floor(Date.parse(publishedAtISO) / 1000)
          : null;

    let durationSeconds = null;
    if (typeof parsed.durationSeconds === "number") {
      durationSeconds = parsed.durationSeconds;
    } else if (
      typeof parsed.durationSeconds === "string" &&
      parsed.durationSeconds.trim() !== ""
    ) {
      const n = Number(parsed.durationSeconds);
      durationSeconds = Number.isFinite(n) ? n : null;
    }

    out.push({
      json: {
        id,
        title: parsed.title ?? null,
        duration: parsed.duration ?? null,
        durationSeconds,
        publishedAt: parsed.publishedAt ?? null,
        publishedAtISO,
        publishedAtEpoch,
        url: parsed.url ?? null,
        channelId: parsed.channelId ?? null,
        videoId: parsed.videoId ?? null,
        processed: false,
      },
    });
  }
}

// Se quiser FIFO: descomente a ordenação abaixo.
// out.sort((a, b) => (a.json.publishedAtEpoch ?? 0) - (b.json.publishedAtEpoch ?? 0));

return { out };
